<style lang="scss" scoped>
.home-contacts-container {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-gap: 2em;
  margin: 10em 0 8em;
  text-transform: uppercase;
  text-align: center;

  & svg{
    display: block;
    margin: 0 auto 1em;
  }
}

.contact:hover{
  & #flag{ transform: rotate(-90deg); }
  & #mail{ animation: mail alternate .8s ease-in-out infinite; }
  & #balloon{ animation: floating alternate 1s ease-in-out infinite; }
  & .bubble{ opacity: 1; }
  & .dot1{ animation: dot1 1s ease-in-out infinite; }
  & .dot2{ animation: dot2 1s ease-in-out infinite; }
  & .dot3{ animation: dot3 1s ease-in-out infinite; }
}

.contact{
  & #flag{
    transition: transform .5s ease;
    transform-origin: 42.5% 7%;
  }
  & .bubble{
    transition: opacity .5s ease;
  }
}

@keyframes mail{
  from { transform: translate(18px, 20px); }
  to   { transform: translate(29px, 20px); }
}
@keyframes floating{
  from { transform: translate(65px, 25px); }
  to   { transform: translate(75px, 20px); }
}
@keyframes dot1{
  from { opacity: 0; }
  10%  { opacity: 0; }
  20%  { opacity: 1; }
  90%  { opacity: 1; }
  to   { opacity: 0; }
}

@keyframes dot2{
  from { opacity: 0; }
  40%  { opacity: 0; }
  50%  { opacity: 1; }
  90%  { opacity: 1; }
  to   { opacity: 0; }
}

@keyframes dot3{
  from { opacity: 0; }
  70%  { opacity: 0; }
  80%  { opacity: 1; }
  90%  { opacity: 1; }
  to   { opacity: 0; }
}


